(13, 'EVOLUSI MANAJEMEN PENELITIAN DAN PENGEMBANGAN:  TANTANGAN BAGI SEKTOR PERTANIAN DAN  PERKEBUNAN INDO', 'Wati Hermawati, Kusbiantono, Sigit Setiawan, Iin Surminah ', 'Development  of  the  management  of  research  and  development  (R&D)  has experienced  very  rapid  progress,  especially  in  relation  to  win  business opportunities  at the  global level.  The  evolution  of R&D  management  at  the global  level  now  has  up  to  the  fifth-generation  led  to  the  sixth  generation, which  is  characterized  by  the  magnitude  of  dependence  on  the information and communication technology as well as the application of the principles of knowledge management in R&D activities.', 'WARTA_KMIL_VOL_11_N0_1_2013_PAPER_1.pdf', '927289', 'application/pdf', , 1);
INSERT INTO `jurnal` (`ID`, `JUDUL`, `PENGARANG`, `ABSTRAK`, `NAME`, `SIZE`, `TYPE`, `CONTENT`, `HITS`) VALUES
(14, 'Morfologi Buah Dan Tingkat Serangan Conopomorpha cramerella Snellen (PBK) Pada Beberapa Klon Kakao', 'Andi Ridwan Jurusan Budidaya ', 'Penggerek  buah  kakao  (PBK)  yang  disebabkan  serangan Conopomorpha cramerella Snellen menjadi permasalahan utama pada tanaman  kakao.  Tingginya  serangan  pada  tanaman dapat\r\nmenyebabkan kerugian yang besar pada petani. Penelitian dilakukan untuk  mengetahui apakah  tingginya  serangan  hama  juga  dipengaruhi oleh  keadaan  morfologi  buah  kakao  yang  berbeda  klon.', '1. ANDI RIDWAN  (93 -98).pdf', '223819', 'application/pdf', , 1);

